package com.hb;import java.util.ArrayList;import java.util.List;/** * @author hubing * @date 2021/09/14 16:18 **/public class Group {    private String name;    private List<Staff> staff = new ArrayList<>();    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public List<Staff> getStaff() {        return staff;    }    public void setStaff(List<Staff> staff) {        this.staff = staff;    }    @Override    public String toString() {        return "Group{" +                "name='" + name + '\'' +                ", staff=" + staff +                '}';    }}